import React, { useState, useEffect } from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";

import Seeddata from "./src/seeddata";
import Signup from "./src/screens/signup";
import Login from "./src/screens/login";

const Stack = createNativeStackNavigator();

// Home Stack Navigator
import HomeStack from "./src/Navigators/HomeStack";
import TabNav from "./src/Navigators/TabNav";


export default function App() {
  const [isLoggedIn, setLoggedIn] = useState(true); // Set to true for testing

  // Function to update login state
  const handleLogin = () => {
    setLoggedIn(true);
  };

  useEffect(() => {
    Seeddata();
    // Assuming Seeddata is a function that seeds data
  }, []);

  return (
    <NavigationContainer>

        <Stack.Navigator screenOptions={{headerShown:false}}>
          <Stack.Screen name="Login">
            {() => <Login onLogin={handleLogin} />}
          </Stack.Screen>
          <Stack.Screen name="Signup" component={Signup} />

          <Stack.Screen name="HomeTab" component={TabNav} />
        </Stack.Navigator>

    </NavigationContainer>
  );
}
